from typing import List


class Solution:
    def maxProduct(self, nums: List[int]) -> int:
        res = None
        max_p = None
        min_p = None

        for idx in range(0, len(nums)):
            cur = nums[idx]
            if idx == 0:
                min_p = max_p = cur
            else:
                tmp_max_p = max(max_p * cur, min_p * cur, cur)
                min_p = min(max_p * cur, min_p * cur, cur)
                max_p = tmp_max_p
            nums[idx] = max_p

        for _ in nums:
            if res is None or res < _:
                res = _

        return res



